const backgroundImage = {
  backgroundImage: `url(${props.backgroundImage})`
}

export default function Playingcard(props){
  return(
    <div className="playingcardwidget">
      <div className="card-group">
        <div className ="big-card card" href={props.card1}></div>
        <div className ="little-card card"></div>
        <div className ="big-card card" href={props.card2}></div>
        <div className ="little-card card"></div>
        <div className ="big-card card" href={props.card3}></div>
        <div className ="little-card card"></div>
        <div className ="big-card card" href={props.card4}></div>
        <div className ="little-card card"></div>
      </div>
    </div>
  )
}
